import React from "react";
import footer from "./images/footer.png";
import second_footer from "./images/second_footer.png";
function Footer() {
return (
    <div>
    <div className="footer">
        <div className="footer_images">
        <img src={second_footer} className="footer_img" />
        <img src={footer} className="second_footer_img" />
        </div>
    </div>
    </div>
);
}

export default Footer;
